w&quot;, Arial; font-size: 15px; -webkit-font-smoothing: antialiased; -webkit-tap-highlight-color: transparent; text-align: justify;\"><li dir=\"rtl\"><font face=\"arial, helvetica, sans-serif\"><span style=\"font-size: 16px;\"><b style=\"font-weight: bold;\">מדי לחימה מאושרים ע\"י משרד הביטחון&nbsp;</b></span></font></li><li><strong style=\"font-weight: bold;\"><span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"font-size: 16px;\">גזרה משוחררת ונוחה עם דגש על טווח תנועה מירבי</span></span></strong></li><li><strong style=\"font-weight: bold;\"><span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"font-size: 16px;\">בד מנדף זיעה בצורה מרבית עם טכנולוגית קירור&nbsp; נקרא ADS הרשום כפטנט ופיתוח עצמאי של KEELA&nbsp; המתאפיין בנידוף זיעה גבוה במיוחד&nbsp;&nbsp;</span></span></strong><br><br><strong style=\"font-weight: bold;\"><span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"font-size: 16px;\">(חולצה מותאמת לטמפ הישראלית ע\"י משרד הביטחון) הבד עשוי מעין רשת.</span></span></strong></li><li><font face=\"arial, helvetica, sans-serif\"><span style=\"font-size: 16px;\"><b style=\"font-weight: bold;\">בד רשת coolmax באזור בית השחי עם פתח למספרי חובש .</b></span></font></li><li dir=\"rtl\"><span style=\"font-size: 16px;\"><span style=\"font-family: arial, helvetica, sans-serif;\"><strong style=\"font-weight: bold;\">&nbsp;צווארון נעמד למניעת שיפשופי עור מהאפוד או מרצועת הנשק באזור הצוואר.</strong></span></span></li><li dir=\"rtl\"><font face=\"arial, helvetica, sans-serif\"><span style=\"font-size: 16px;\"><b style=\"font-weight: bold;\">רוכסןYKK 1/4 לאוורור עם בד כפול למניעת לחץ ושיפשופים.</b></span></font></li><li dir=\"rtl\"><span style=\"font-size: 16px;\"><span style=\"font-family: arial, helvetica, sans-serif;\"><strong style=\"font-weight: bold;\">חולצה קלה,מתאוורת בקלות .</strong></span></span></li><li style=\"text-align: right;\"><font face=\"arial, helvetica, sans-serif\"><span style=\"font-size: 16px;\"><b style=\"font-weight: bold;\">כיסי שרוול- כיס תחתון על רוחסן,כיס עליון על וולקרו(סקוטץ) עם כיס קטן בפנים בגודל חוגר,מקום לעט,מקום לסטיקלייט.</b></span></font><span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"font-size: 16px;\"><strong style=\"font-weight: bold;\">טבעת D&nbsp;לשיפצורים בתוך ומחוץ לכיס</strong>.</span></span>&nbsp;<font face=\"arial, helvetica, sans-serif\"><span style=\"font-size: 16px;\"><b style=\"font-weight: bold;\">הכיסים נמצאים בשיפוע קל לפתיחה נח.מעל הכיס יש וולקרו להדבקת&nbsp;</b></span></font><span style=\"font-size: 16px;\"><span style=\"font-family: arial, helvetica, sans-serif;\"><strong style=\"font-weight: bold;\">פאצ\'ים&nbsp;כמו דגל ישראל,שם,סמל יחידה,סוג דם וכו...</strong></span></span></li><li style=\"text-align: right;\"><span style=\"font-size: 16px;\"><span style=\"font-family: arial, helvetica, sans-serif;\"><strong style=\"font-weight: bold;\">וולקרו על הכתפים לדרגות קצין</strong></span></span></li><li dir=\"rtl\" style=\"text-align: right;\"><span style=\"font-size: 16px;\"><span style=\"font-family: arial, helvetica, sans-serif;\"><strong style=\"font-weight: bold;\">שרוולים - 50% כותנה 50% ניילון Ripstop&nbsp;</strong></span><strong style=\"font-weight: bold; color: rgb(102, 102, 102); font-family: arial;\"><span style=\"font-family: &quot;Times New Roman&quot;;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: arial, helvetica, sans-serif;\">החסין נגד קריעה</span></span></span></strong><span style=\"font-family: arial, helvetica, sans-serif;\"><strong style=\"font-weight: bold;\">. גוף:100% פוליאסטר בחיבור הפנימי בין הבדים בוצעה הלחמה באמצעות סרט שחור אלסטי למניעת קריעת החיבור בין הבדים&nbsp; &nbsp;</strong></span></span><strong style=\"font-weight: bold;\"><span style=\"color: rgb(75, 75, 75); font-family: Roboto, sans-serif; font-size: 16px; white-space: pre-wrap;\">בחולצה הבד המנדף תמיד יותר חלש מבד הריפסטופ. כך שבתפר מחוברים בד חזק עם בד חלש יותר. לאורך זמן הבד המנדף יקרע לאורך התפר. הסרט מולחם על כל התפרים שמחברים בד מנדף לבד ריפסטופ, הוא אלסטי (נמתח) ומטרתו העיקרית לספוג את המאמצי המתיחה באזור התפר ולמנוע קריעה של הבד המנדף.הסרט האלסטי סופג את המאמצים במקום הבד המנדף ומונע את הקריעה שלו</span></strong></li><li dir=\"rtl\" style=\"text-align: right;\"><span style=\"font-size: 16px;\"><strong style=\"font-weight: bold; color: rgb(102, 102, 102); font-family: arial;\"><span style=\"font-family: &quot;Times New Roman&quot;;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: arial, helvetica, sans-serif;\">התפרים שטוחים ולא יוצרים חיכוך בגוף.</span></span></span></strong></span></li><li dir=\"rtl\" style=\"text-align: right;\"><span style=\"font-size: 16px;\"><strong style=\"font-weight: bold; color: rgb(102, 102, 102); font-family: arial;\"><span style=\"font-family: &quot;Times New Roman&quot;;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: arial, helvetica, sans-serif;\">בנקודת המרפק תפור בד כפול לשיפור ההתנגדות לשחיקה.</span></span></span></strong></span></li><li dir=\"rtl\" style=\"text-align: right;\"><span style=\"font-size: 16px;\"><strong style=\"font-weight: bold; color: rgb(102, 102, 102); font-family: arial;\"><span style=\"font-family: &quot;Times New Roman&quot;;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: arial, helvetica, sans-serif;\">ניתן להוסיף רפידות מרפק D30 אופציונליות בכיס פנימי.</span></span></span></strong></span></li></ul><div class=\"font_8\" style=\"color: rgb(0, 0, 0); font-family: &quot;open sans hebrew&quot;, Arial; font-size: 15px; text-align: right; -webkit-font-smoothing: antialiased; -webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; border: 0px; outline: 0px;\"><strong style=\"font-weight: bold;\"><span style=\"font-size: 16px;\"><span style=\"font-family: arial, helvetica, sans-serif;\">מאפיינים נוספים:</span></span></strong></div><ul style=\"margin-bottom: 10px; padding: 0px 20px; list-style-position: inside; color: rgb(0, 0, 0); fon